// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./RealEstate.sol";

contract RealEstateRental {
    RealEstate public realEstate;

    struct Rental {
        address tenant;
        uint256 startDate;
        uint256 endDate;
        uint256 yearlyRent;
        bool isActive;
        string propertyName;
        string propertyLocation;
    }

    mapping(uint256 => Rental) public propertyRentals;
    mapping(address => uint256[]) public userRentals;

    event PropertyRented(
        uint256 indexed propertyId,
        address indexed tenant,
        uint256 startDate,
        uint256 endDate,
        uint256 yearlyRent
    );

    event RentalPaymentDistributed(
        uint256 indexed propertyId,
        address indexed shareholder,
        uint256 amount,
        uint256 paymentDate
    );

    constructor(address _realEstateAddress) {
        realEstate = RealEstate(_realEstateAddress);
    }

    function rentProperty(uint256 _propertyId, uint256 _years) public payable {
        require(_years >= 1 && _years <= 10, "Rental period must be between 1 and 10 years");
        require(realEstate.isUserRegistered(msg.sender), "User not registered");

        // Get property details
        (
            string memory name,
            string memory location,
            uint256 totalValue,
            ,
            uint256 availableShares,
            ,
            ,
            bool isListed
        ) = realEstate.getProperty(_propertyId);

        require(isListed, "Property not listed");
        require(availableShares == 0, "All shares must be sold before renting");

        // Calculate yearly rent (50% of total value)
        uint256 yearlyRent = totalValue / 2;
        uint256 totalRent = yearlyRent * _years;
        require(msg.value >= totalRent, "Insufficient payment for rent");

        // Set up rental
        uint256 startDate = block.timestamp;
        uint256 endDate = startDate + (_years * 365 days);
        
        propertyRentals[_propertyId] = Rental({
            tenant: msg.sender,
            startDate: startDate,
            endDate: endDate,
            yearlyRent: yearlyRent,
            isActive: true,
            propertyName: name,
            propertyLocation: location
        });

        // Add to user's rental list
        userRentals[msg.sender].push(_propertyId);

        // Distribute rental payment to shareholders
        distributeRentalPayment(_propertyId);

        emit PropertyRented(_propertyId, msg.sender, startDate, endDate, yearlyRent);
    }

    function distributeRentalPayment(uint256 _propertyId) public payable {
        Rental storage rental = propertyRentals[_propertyId];
        require(rental.isActive, "No active rental for this property");

        // Get shareholders from RealEstate contract
        address[] memory shareholders = realEstate.getPropertyShareholders(_propertyId);
        uint256 totalShares = 0;

        // Calculate total shares
        for (uint256 i = 0; i < shareholders.length; i++) {
            totalShares += realEstate.getPropertyShares(_propertyId, shareholders[i]);
        }

        require(totalShares > 0, "No shares found");

        // Distribute payment to each shareholder
        for (uint256 i = 0; i < shareholders.length; i++) {
            address shareholder = shareholders[i];
            uint256 shares = realEstate.getPropertyShares(_propertyId, shareholder);
            
            if (shares > 0) {
                uint256 payment = (rental.yearlyRent * shares) / totalShares;
                payable(shareholder).transfer(payment);

                emit RentalPaymentDistributed(
                    _propertyId,
                    shareholder,
                    payment,
                    block.timestamp
                );
            }
        }
    }

    function getUserRentals(address _user) public view returns (uint256[] memory) {
        return userRentals[_user];
    }

    function getRentalDetails(uint256 _propertyId) public view returns (
        address tenant,
        uint256 startDate,
        uint256 endDate,
        uint256 yearlyRent,
        bool isActive,
        string memory propertyName,
        string memory propertyLocation
    ) {
        Rental storage rental = propertyRentals[_propertyId];
        return (
            rental.tenant,
            rental.startDate,
            rental.endDate,
            rental.yearlyRent,
            rental.isActive,
            rental.propertyName,
            rental.propertyLocation
        );
    }

    function isPropertyRented(uint256 _propertyId) public view returns (bool) {
        return propertyRentals[_propertyId].isActive;
    }
}
